import React from "react";
import "./Pages.css";

type SlideProps = {
  numberSlide: number;
  setNumberSlide: (number: number) => void;
};

const WhatIKnowPage: React.FC<SlideProps> = ({
  numberSlide,
  setNumberSlide,
}) => {
  return (
    <>
      <div className="slider-container header">
      <div className="wrapper">
        
      </div>
        <div className="icon" onClick={() => setNumberSlide(3)}>
          Next Slide
        </div>
        <div className="icon" onClick={() => setNumberSlide(1)}>
          Prev Slide
        </div>
      </div>
    </>
  );
};

export default WhatIKnowPage;
